import './Introduction.css';
import { TypeAnimation } from 'react-type-animation';
const Introduction = () =>{
    return(
        <TypeAnimation
      sequence={
        <div className="introduction">
    <h1 className='white f1 mt5'>Hi, my name is Regi Loshi <br/>I'm a  Software Engineering Student.</h1>
    </div>
      }
      wrapper="span"
      cursor={true}
      repeat={Infinity}
      style={{ fontSize: '2em', display: 'inline-block' }}
    />
  );
};
export default Introduction;
